import React from "react";
import "./ServiceBentoGrid.css";
import { FaBrain, FaRobot, FaSearch, FaLanguage, FaChartLine } from "react-icons/fa";

const services = [
  {
    title: "AI Search",
    description: "Natural language search powered by advanced AI algorithms.",
    icon: <FaSearch />,
  },
  {
    title: "Multilingual Support",
    description: "Understand and respond in over 100 languages.",
    icon: <FaLanguage />,
  },
  {
    title: "Semantic Understanding",
    description: "Deep understanding of context and user intent.",
    icon: <FaBrain />,
  },
  {
    title: "Conversational AI",
    description: "Human-like conversations with contextual memory.",
    icon: <FaRobot />,
  },
  {
    title: "Analytics",
    description: "Track and visualize query patterns and trends.",
    icon: <FaChartLine />,
  },
];

const ServiceBentoGrid = () => {
  return (
    <div className="dashboard-wrapper">
      <div className="dashboard">
        {services.map((service, index) => (
          <div className="bento-card" key={index}>
            <h2>
              <span className="icon-container">{service.icon}</span>
              {service.title}
            </h2>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ServiceBentoGrid;
